<style>   
  body {
    font-family: "Roboto Mono", "Helvetica", sans-serif;

    font-size:14px;
    font-weight:300;
    line-height:1.2;
  }

  #dark {
    background-color: #242731; /*#0c1d2a;*/ /*#fdf9f0;*/ /*#384953;*/ /*#fdf9f0;*/ /*#384953;*/
    color: #8797a0;
   
  }
  #dark svg.graph {
      background-color: #242731; /*#0a1d2b;*/ /*#fdf9f0; *//*#ece4d2;*/ 
      margin: 0px;
      /*box-shadow: 2px 2px 20px 2px #384953;*/
      /*box-shadow: inset 0px 0px 10px 2px #384953;*/
      box-shadow: 0px 0px 5px 1px #384953;
  }

  #light {
    color: #242731; /*#0c1d2a;*/
    background: #ffffff; /*#e4e7e8;*/
  }
  #light svg.graph {
      background-color: #ffffff; /*#e4e7e8;*/
      margin: 0px;
      /*box-shadow: 2px 2px 20px 2px #384953;*/
      /*box-shadow: inset 0px 0px 10px 2px #384953;*/
      box-shadow: inset 0px 0px 5px 1px #384953;

  }


  .well {
    padding: 20px 20px 20px 20px;
  }

  .well .well {
    padding: 10px 10px 10px 10px;
  }
  #dark .well {
    color:#e4e7e8;
    background-color: #242731;
    border-color:#e4e7e8;

  }
  #light .well {
    color:#242731;
    background: #ffffff; /*#e4e7e8;*/
    border-color:#242731;
  }

  .navbar { 
      padding: 1rem 0rem;
   }
  .navbar-inverse2 {
    background-color:#ffffff00;
    border-color:#2220;
  }

  #dark .navbar-inverse {
    background-color: #ffffff00;/*#242731;*/
    border-color:#2220;
  }

  #light .navbar-inverse {
    background-color: #ffffff00; /*#ffffff;*/ /*#e4e7e8;*/
    border-color:#2220;
  }

  #dark .navbar-inverse .navbar-nav>li>a {
      color:#e4e7e8;
  }
  #light .navbar-inverse .navbar-nav>li>a {
      color:#242731;
  }
  #dark .navbar-brand {
    color: #00bcdb;
  }
  #light .navbar-brand {
    color: #00bcdb;
  }
   a.navbar-brand:hover {
    /*color: #00dbff !important;*/
   }

  .navbar-dyneusr {
   background: #0c1d2a; /*#384953;*/
   border-color: #0c1d2a; /*#2b3c4e;*/
   line-height: 20px;
   color: #8797a0; /*#fdf9f0;*/ 
   box-shadow: 0px 0px 10px 3px #384953; /*#161d21;*/
  }
  h1, h2 {
   font-size:24px;
   font-weight: 300;
   color: #00bcdb; /* #ece4d2;*/
  }
  h2 {
    font-size: 18px;
    padding-bottom: 10px;
    font-weight: 700;
  }
  h3 {
    font-size:16px;
    font-weight: 700;
    /*float: left;*/
    padding-right: 8px;
    display: inline-block;
  }


  .node { 
    opacity: 1.0;
  }
  .node#defocus { 
    opacity: 0.3;
  }
  #dark .node .circle {
    stroke: #fff;
    stroke-width: 0.5px;
  }
  #dark .node#hover .circle,
  #dark .node#highlight .circle,
  #dark .node#focus .circle {
    opacity: 1.0;
    stroke: #fff; /*#00bcdb;*/
    stroke-width: 1.5px;
  }

  #light .node .circle {
    stroke: #000;
    stroke-width: 0.5px;
  }
  #light .node#hover .circle,
  #light .node#highlight .circle,
  #light .node#focus .circle {
    opacity: 1.0;
    stroke: #000; /*#00bcdb;*/
    stroke-width: 1.5px;
  }

  #dark .link {
    opacity: 1.0;
    stroke: #777;
    stroke-opacity: 0.5;
    stroke-width: 1.5px;
  }
  #light .link {
    opacity: 1.0;
    stroke: #777;
    stroke-opacity: 0.5;
    stroke-width: 1.5px;
  }
  .link#defocus {
    opacity: 0.3;
  }

  #dark .link#hover,
  #dark .link#highlight,
  #dark .link#focus {
    stroke: #fff;
    stroke-opacity: 1.0;
    stroke-width: 3.0px;
  }
  #light .link#hover,
  #light .link#highlight,
  #light .link#focus {
    stroke: #000;
    stroke-opacity: 1.0;
    stroke-width: 3.0px;
  }


  .node text {
    display: none;
    font: 10px sans-serif;
  }

  .node:hover text {
    display: inline;
  }

  .cell {
    fill: none;
    pointer-events: all;
  }


  #tooltip {
    position: absolute;
    bottom: 0;
    left: 0;
    bottom: 0;
    width: 400px;
    padding: 20px;
    overflow: auto;
    display: none;
  }

  .tooltip-image {
    width: 100%; 

  }
  #main {
    position: relative;
      overflow: auto;
      padding-top:15px;
      /*width:70%;*/
      top:65px;
  }
  #meta {
    opacity: 0.85;
    position: fixed;
      top: 65px;
      right: 0px;
      height:100%;
      padding: 15px;
      overflow: auto;
      display: block;
  }
  #dark #meta {
    background-color: #242732 ;
  }

  #light #meta {
    background-color:#ffffff; /*#e4e7e8;*/
  }
  #main-container {
    height:100%;
  }

  svg.legend {
      margin-right:20px;
  }
  #dark text.legend-text {
    fill:#e4e7e8;
  } 
  #light text.legend-text {
    fill:#242731;
  }

  .menu-choice {
    font-size: 14pt;
    margin-bottom:0px;
    border: 0px solid #fff;
    background-color: transparent;
    width:100%;
  }
  .menu-button {
    font-size: 14pt;
    margin-bottom:0px;
    border: 0px solid #fff;
    background-color: transparent;
    width:100%;
  }
  
  #node-meta table,
  #node-meta tr,
  #node-meta td {
    text-align: center;
    padding: 5px ;
  }
     
  </style>

<script>

///////////////////////////////////////////////

    // 'castillo': ['#000000','#0500ff', '#65ff00',  '#fae23d', '#ff8c00', '#ff0000', '#7C19FF'],
    
    //               None      Instruct   Rest        Memory     Video      Math       TaskPositive

    'castillo':    ['#777777','#0500ff', '#65ff00',  '#fae23d', '#ff8c00', '#ff0000', '#7C19FF'],


    // castillo 1-hot coloringsss
    //'white':   ['#777', '#ffffff'],
    'castillo (black)':   ['#777', '#000000'],
    'castillo (blue)':    ['#777', '#0500ff'],
    'castillo (green)':   ['#777', '#65ff00'],
    'castillo (yellow)':  ['#777', '#fae23d'],
    'castillo (orange)':  ['#777', '#ff8c00'],
    'castillo (red)':     ['#777', '#ff0000'],
    'castillo (purple)':  ['#777', '#7C19FF'], 

    //               None      Instruct   Rest       TaskPositive
    // 'task groups': ['#000000','#0500ff', '#65ff00', '#7C19FF'],




    //'castillo5': ['#0500ff', '#65ff00',  '#fae23d', '#ff8c00', '#ff0000'],

    'kepler3': ['#0500ff', '#65ff00', '#ff0000'],
    'kepler5': ['#0500ff', '#00a4ff', '#65ff00', '#ff8c00', '#ff0000'],

    'viridis3':['#440154', '#21918c', '#fde725'],
    'viridis5': ['#440154', '#3b528b', '#21918c', '#5ec962', '#fde725'],

                 '#2e6e8e', '#277f8e', '#21918c', '#1fa187', '#2db27d', 
                 '#4ac16d', '#73d056', '#a0da39', '#d0e11c', '#fde725'],

    'category10': d3.scale.category10().range(),
    'category20': d3.scale.category20().range(),


    };
///////////////////////////////////////////////
// Helpers
///////////////////////////////////////////////
if (!d3.select("#json_graph").empty()) {
    load_force_graphs();
} else {
    load_force_graphs_csv("graphs/haxby_decoding_neumapper_dyneusr.csv");
}

// Load a list of JSON files
function load_force_graphs() {
  d3.select("#json_graph").forEach(function(element) {
    // console.log(element[0]);
    var data = JSON.parse(element[0].dataset.json);
    var inputs = {data:data, source:"default", total:1};
    console.log(inputs);
    draw_force(inputs);
  });
}

// Load a list of JSON files
function load_force_graphs_csv(csv) {
    d3.csv(csv, function(error, data) {
      data.forEach(function(d, i) {
        console.log({"i":i, "data.length":data.length, "data[i]":d});
        load_force_graph(d.json, data.length);
    }); 
  });
}

function load_force_graph(json, n) {
    d3.json(json, function(error, data) {
      var inputs = {data:data, source:json, total:n};
      console.log(inputs);
      draw_force(inputs);
  });
}



//allow 10 times zoom in or out
function zoomer () {
  return d3.behavior.zoom()
    .scaleExtent([0.1,7])
    .on("zoom", zoom);
}

//define the event handler function
function zoom() {
    // console.log("zoom", d3.event.translate, d3.event.scale);
    d3.selectAll("g.zoomable").attr("transform", 
             "translate(" + d3.event.translate + ")" 
         + " scale(" + d3.event.scale + ")" );
};


// Draw json
function draw_force(data) {
  
  // fixed random seed, for layout reproducibility (change string to randomize layout) 
  Math.seedrandom('dyneusr is awesome');

  ////////////////////////////////////////////////////
  //// inits
  ////////////////////////////////////////////////////
  var json = data.data,
      source = data.source,
      n = data.total;

  var ncols = d3.min([n, 3]);
  var nrows = d3.max([1, Math.round(n / 3)]);
  var colsize = 12 / ncols;

  var margin = {top: 0, right: 0, bottom: 100, left: 0};
  var width = (window.innerWidth / ncols) - margin.left - margin.right;
  var height = (window.innerHeight / ncols) - margin.top - margin.bottom;
  console.log({margin: margin});
  console.log({ncols: ncols, nrows:nrows});
  console.log({width:width, height:height});

  var div = d3.select("#main")
      .append("div")
      .attr("class", "col-lg-" + colsize)
      .attr("width", width)
      .attr("height", height)
      .attr("display", "inline-block");
  //width = document.getElementById("main").offsetWidth;
  console.log({width:width, height:height});

  
  var svg = div.append("svg")
    .attr("id", "svg")
    .attr("class", "graph")
    .attr("width", "100%")
    .attr("height", height)
    .call(zoomer())
    .append("g")
      .attr("class", "zoomable");
      

  ////////////////////////////////////////////////////
  // resizing function 
  d3.select(window).on("resize", resize);
  d3.select("a#toggle_meta").on('click', resize);
  function resize() {
    
    // get the old width, height
    var old_width = parseInt(d3.select("#main div").attr("width"))
    var old_height = parseInt(d3.select("#main div").attr("height"))
    //console.log([new_width, old_width, old_height])
    // TODO: make sure this matches the ncols, margins defined in draw_force
    //var ncols = 1;
    //var margin = {top: 0, right: 0, bottom: 100, left: 0}; 
    //var new_width = (window.innerWidth / ncols) - margin.left - margin.right;
    var new_height = (window.innerHeight / ncols) - margin.top - margin.bottom;
    var new_width = $("svg#svg").width() ;
    if ((new_height !== old_height) || (new_width !== old_width)) {
      d3.select("#main").attr("height", new_height)      //.attr("width", old_width);
      d3.select("#svg").attr("height", new_height)       //.attr("width", new_width);
      d3.select("g.zoomable").attr("height", new_height) //.attr("width", new_width).attr("top","200px");
      force.size([new_width, new_height]).resume();
    }
  }



  ////////////////////////////////////////////////////
  //// Reindex nodes, links
  ////////////////////////////////////////////////////
  // get mapping of node id => index
  var node_index_from = {name:{}, id:{}};
  json.nodes.forEach(function(d,i) {
    // add to mapping
    node_index_from.name[d.name] = i;
    node_index_from.id[d.id] = i;
    // update name, id
    json.nodes[i].id = i;
  });

  // reindex links
  json.links.forEach(function(d,i) {
    if (typeof node_index_from.id[d.source] !== "undefined") {
      // save source, target
    //d.source_id = d.source;
    //d.target_id = d.target;
    // update link source, target
    d.source = node_index_from.id[d.source];
    d.target = node_index_from.id[d.target];
    } else if (typeof node_index_from.name[d.source] !== "undefined") {
      // save source, target
    //d.source_name = d.source;
    //d.target_name = d.target;
    // update link source, target
    d.source = node_index_from.name[d.source];
    d.target = node_index_from.name[d.target];
    }
    // update link data
    json.links[i] = d;
  });

  ////////////////////////////////////////////////////
  //// Force setup
  ////////////////////////////////////////////////////
  var w = Math.round(width * 1) ;
  var h = Math.round(height * 1) ;

  var force = d3.layout.force()
      .gravity(0.5)
      .charge(-300)
      .linkDistance(1)
      .size([w, h])
      .nodes(json.nodes)
      .links(json.links)
      //.linkDistance(function(link) {return Math.sqrt(link.distance);})
      .start();


  ////////////////////////////////////////////////////
  //// Colors + labels setup
  ////////////////////////////////////////////////////
  // color by
  var color_by_options = {};
  json.nodes.map(function(d,i) {
      d3.keys(d.proportions).map(function(k) {
        if (color_by_options[k]!==true) {
          color_by_options[k] = true;
        }
      });
    });
  color_by_options = d3.keys(color_by_options);
  console.log({color_by_options:color_by_options});

  var color_by = json.graph.color_by ? json.graph.color_by : color_by_options[0];  
  console.log({color_by: color_by});


  // colors
  var groups = {};
  var labels = {};
  if (typeof json.graph.groups !== "undefined") {
    d3.keys(json.graph.groups).map(function(k, i) {
      groups[k] = json.graph.groups[k];
    });
  }
  color_by_options.map(function(k) {
    // console.log(k)
    groups[k] = {};
    labels[k] = {};
    json.nodes.map(function(d,i) {
      d.proportions[k].map(function(p,j) {
        if (groups[k][p.group]!==true) {
          groups[k][p.group] = true;
          labels[k][p.group] = p.label || k.concat(" = ", p.group.toString());
        }
      })
    })
    groups[k] = d3.keys(groups[k]);
    labels[k] = d3.values(labels[k]); // reindex like groups[k]
  });
  console.log({groups: groups});
  console.log({labels: labels});

  // quick encoding for groups to ints
  var groups_to_int = {};
  var groups_to_frac = {};
  d3.keys(groups).map(function(k) {
    groups_to_int[k] = {};
    groups[k].map(function(i, g) {
      groups_to_int[k][parseInt(i)] = parseInt(g);
    });
    groups_to_frac[k] = {};
    groups[k].map(function(i, g) { 
      // groups_to_frac[k][g] = g / d3.max(d3.values(groups[k])) || 0;
      // groups_to_frac[k][g] = g / (groups[k].length - 1) || 0;
      groups_to_frac[k][parseFloat(i)] = (g / (groups[k].length - 1)) || 0;
      // groups_to_frac[k][parseFloat(i)] = parseFloat(i) / d3.max(d3.keys(groups_to_int[k])) || 0; 
    });
  });
  console.log({groups_to_int: groups_to_int});
  console.log({groups_to_frac: groups_to_frac});



  // set custom color palette if defined
  //var color_palette_key = 'kepler15';
  // hack for castillo cme data
  color_palette_key = "multiclass";
  if (groups[color_by].length <= 3) {
    color_palette_key = 'kepler3';
  } else if (groups[color_by].length <= 5) {
    color_palette_key = 'kepler5';
  } 
  color_palette_key = "multiclass";
  console.log({color_palette_key: color_palette_key});

  // check for custom color palettes
  var custom_colors = json.graph.colors ? json.graph.colors : json.graph.color;
  if (typeof custom_colors !== "undefined") {
    d3.keys(custom_colors).map(function(k, i) {
      color_palettes[k] = custom_colors[k];      
    })
  }
  // use color_by as color_palette_key, if it is valid
  //if (typeof color_palettes[color_by] !== "undefined") {
  //  color_palette_key = color_by;
  //}  
  var color_palette = color_palettes[color_palette_key];

  // define color scale
  //var color = d3.scale.linear()
  //  .domain(groups[color_by])
  //  .range(color_palette);
  var color = d3.scale.linear()
  color = color.domain(groups[color_by])
  color = color.range(d3.values(groups_to_frac[color_by]).map(function(g) {
    return color_palette[Math.round(g * (color_palette.length-1))]
  }))
  console.log({'color.domain()': color.domain(), 
               'color.range()':  color.range()});
     

  // color labels
  var color_labels = {};
  d3.keys(groups).map(function(k, i) {
    color_labels[k] = labels[k];
  })
  // d3.keys(groups).map(function(k, i) {
  //  color_labels[k] = groups[k];
  //});
  if (typeof json.graph.labels !== "undefined") {
    d3.keys(json.graph.labels).map(function(k, i) {
      color_labels[k] = json.graph.labels[k];
    })
  } else if (typeof json.graph.label !== "undefined") {
    d3.keys(json.graph.label).map(function(k, i) {
      color_labels[k] = json.graph.label[k];
    })
  }
  // make sure labels match up with groups 
  d3.keys(color_labels).map(function(k) {
    if (typeof groups[k] === "undefined") return;
    if (color_labels[k].length === (groups[k].length - 1)) {
      color_labels[k].unshift("None"); // add dummy None label to beginning
    }
  })
  console.log({color_labels: color_labels});


  //var color_label = d3.scale.ordinal()
  //          .domain(color_labels[color_by])
  //          .range(color.range());
  var color_label =  d3.scale.ordinal()
  color_label = color_label.domain(color_labels[color_by])
  color_label = color_label.range(color.range())
  console.log({'color_label.domain()': color_label.domain(), 
               'color_label.range()':  color_label.range()}); 
  
    
  // node-pie 
  var pie = d3.layout.pie()
            .sort(null)
            .value(function(d) { return d.value; });
    
  // scale pie by max row count
  var data_size = d3.max(json.nodes.map(d => { 
        return d3.max(d.members) + 1;
    }));
  console.log({data_size: data_size});

  var pie_size = json.nodes.map(d => { 
    return d3.max(d.proportions[color_by].map(p => 
        { return p.row_count; }
            ));
      });

  console.log({pie_size: pie_size});
  var inner_radius = 0;
  var min_outer_radius = 5;  // 3
  var max_outer_radius = 30; // 50
  // size node proportional to data
  //var pie_norm = d3.scale.log()
  //    .domain([1, data_size])
  //    .rangeRound([3, 30]) //data_size)]);
  
  var pie_norm = d3.scale.sqrt()
      .domain([1, data_size])
      .rangeRound([min_outer_radius, max_outer_radius]) //data_size)]);
  //.rangeRound([2, 15]);
  console.log({"pie_norm(1)"   : pie_norm(1),
               "pie_norm(10)"  : pie_norm(10),
               "pie_norm(100)" : pie_norm(100),
               "pie_norm(1000)": pie_norm(1000)});

  var link = svg.selectAll(".link")
      .data(json.links)
      .enter().append("line")
      .attr("class", "link");

  var node = svg.selectAll(".node")
      .data(json.nodes)
      .enter().append("g")
      .attr("class", "node")
      .call(force.drag);

  var circle = node.selectAll("path")
      .data(function(d, i) {return pie(d.proportions[color_by]); })
      .enter()
      .append("svg:path")
        .attr("d", d3.svg.arc().innerRadius(inner_radius).outerRadius(function(d) {
          var outer_radius = pie_norm(d.data.row_count);
          if (isNaN(outer_radius)) { outer_radius = min_outer_radius };
          return outer_radius + inner_radius;
        }))
        .attr("fill", function(d) { return color(d.data.group); })
        .attr("class", "circle");
      


  //var label = node.append("text")
  //  .attr("dy", ".25em")
  //  .attr("dx", "1em")
  //  .text(function(d) { return d.name + " (n="+d.members.length+")";});
  var label = node.append("a")
      .attr("href", "#")
      .attr("class", "pop")
      .attr("data-toggle", "popover")
      .attr("data-placement", "right")
      .attr("title", function(d) { return d.name; })
      .attr("data-content", function(d) { return "size : "+d.members.length; })
      .html("text");



  ////////////////////////////////////////////////////
  //// Node Position functions / settings
  ////////////////////////////////////////////////////
  // position by
  var w = $("svg#svg").width();  //width;  //750;
  var h = $("svg#svg").height(); //height  //750;
  var max_node_size = d3.max(d3.values(json.nodes).map(d => {return d.size;}));
  var max_node_degree = d3.max(d3.values(json.nodes).map(d => {return d.degree;}));
  //console.log('max_node_degree: '+max_node_degree);
  //console.log('max_node_size: '+max_node_size);
  var xaxis_scale = d3.scale.linear().domain([0, 1]).range([w*0.08, w*0.88]);
  var yaxis_scale = d3.scale.linear().domain([1, 0]).range([h*0.08, h*0.92]);

  var num_to_pos = function(v) {
    //return {x:(xy * w/2), y:h-(xy * h/2)};
    var x = !isNaN(v) ? v : 0 ;
    var y = !isNaN(v) ? v : 0 ;
    return {x:xaxis_scale(x), y:yaxis_scale(y)}
  }
  
  // initialize layout functions
  var pos_functions = {}
  var pos_by_x = "force";
  var pos_by_y = "force";

  // interactive force layout 
  pos_functions["force"] = function(d) { 
    return {x:d.x, y:d.y}; 
  } 

  // custom pos
  var custom_layouts = json.graph.custom_layouts ? json.graph.custom_layouts : {};
  d3.keys(custom_layouts).map(function(k) {
    // assume position is defined for each node
    // i.e., pos = {'custom': {1: [x, y], ...}}
    pos_functions[k] = function(d) {
      var xy = custom_layouts[k][d.name];
      return num_to_pos( xy );
    };
  });


  
  
  // some more func options based on colorings
  color_by_options.map(function(k) {
    if (k==="uniform" || k==="degree" || k==="data_id") { 
      return;
    } else if (typeof pos_functions[k] !== "undefined") {
      return;
    }

    if (groups[k].length > 2) { 
      // set xy = (normalized) group of the largest slice of the pie (winner takes all)
      pos_functions[k] = function(d) {
        var winner = d3.maxIndex(d3.values(d.proportions[k]).map(p => p.value));
        var xy = groups_to_frac[k][parseFloat(d.proportions[k][winner].group)];
        return num_to_pos( xy );
      } 

    } else {
      // (weighted) (for binary proportions only)
      //
      // k_wts = k + ' (weights)'
      // if (k==="uniform" || k==="degree" || k==="data_id") { 
      //   return;
      // } else if (typeof pos_functions[k_wts] !== "undefined") {
      //   return;
      // } 
      //
      // if (groups[k].length > 2) { 
      //   return;
      // }
      // 
      // set xy = # of times group is found in node / # members in node
      // pos_functions[k + ' (weights)'] = function(d) {
      pos_functions[k] = function(d) {
        var xy = 0;
        d3.values(d.proportions[k]).map(function(p) {
          if ((p.label === k) || (p.group === 1)) {
            xy = (p.value / p.row_count);  
            //xy = groups_to_frac[k][parseFloat(p.group)] * (p.value / p.row_count);  
          }
        })
        return num_to_pos( xy );
      }
    
    }
  });

  /* // (diversity) (for binary proportions only)
  color_by_options.map(function(k) {
    pos_functions[k + " (diversity)"] = function(d) {
      var p = d.proportions[k];
      var xy = d3.keys(p).length / d3.keys(groups[k]).length;
      return num_to_pos( xy );
    };
  }); */

  // add default layout functions last (moved from above)
  pos_functions["node size"] = function(d) {
    return num_to_pos( d.size / max_node_size )
  };
  pos_functions["node size (sqrt)"] = function(d) {
    return num_to_pos( Math.sqrt(d.size / max_node_size) )
  };
  pos_functions["node degree"] = function(d) {
    return num_to_pos( d.degree / max_node_degree )
  };
  pos_functions["node degree (sqrt)"] = function(d) {
    return num_to_pos( Math.sqrt(d.degree / max_node_degree) )
  };
  pos_functions["node index"] = function(d) { 
    return num_to_pos( d.index / d3.values(json.nodes).length ) 
  };
  pos_functions["members (min)"] = function(d) {
    return num_to_pos( d3.min(d.members) / data_size )
  };
  pos_functions["members (mean)"] = function(d) {
    return num_to_pos( d3.mean(d.members) / data_size )
  };   
  pos_functions["members (median)"] = function(d) {
    return num_to_pos( d3.median(d.members) / data_size )
  };  
  pos_functions["members (max)"] = function(d) {
    return num_to_pos( d3.max(d.members) / data_size )
  };   
  pos_functions["data_id"] = function(d) {
    var k = "data_id";
    var winner = d3.maxIndex(d3.values(d.proportions[k]).map(p => p.value));
    var xy = groups_to_frac[k][parseFloat(d.proportions[k][winner].group)];
    return num_to_pos( xy );
  };  
  pos_functions["center"] = function(d) { 
    return num_to_pos( 0.5 ) 
  };  




  ////////////////////////////////////////////////////
  //// Menu + Menu Options
  ////////////////////////////////////////////////////
  // images ?
  var div = d3.select("#meta");
  
  // init Graph Meta section
  d3.select('#graph-meta')
    .append("div")
    .attr("id", "source")
    .html("<h4>Source</h4><div class='well'>"+source+"</div>");
  d3.select('#node-meta')
    .html("<h4>Node</h4><div class='well'></div>");


  // Create a new menu with options
  // TODO: move to something like dat.gui at some point
  const Menu = function(container) {
    this.container = d3.select(container);
    this.options = {};
    this.buttons = {};
    var self = this;

    // add an option to the menu
    this.add_option = function(name, values, selected, callback) {  
      // check inputs
      if (d3.keys(values)[0] !== "0") {
        values = d3.keys(values);
      }
      // initialize 
    var option = self.container
      .append("div").html("<h4>"+name+"</h4>")
      .append("div").attr("class", "well").attr("id", "menu-" + name.split(" ").join("-").toLowerCase())
      .append("select").attr("class", "menu-choice");
    // add data
    option.selectAll("option")
      .data(values).enter().append("option")
        .attr('value', function (d) {/*console.log(d);*/ return d;})
        .text(function (d) {/*console.log(d);*/ return d;})
        .property("selected", function(d){ return d === selected; });
    // add callback
    option.on("change", callback);
    // store
    self.options[name] = option;
    return option;

  ////////////////////////////////////////////////////
  //// Movie
  ////////////////////////////////////////////////////   
  var movie_playing = null;
  var focus_i = null;
  var movie_start_pos = 0;   
  function update_movie(e) {
    if (movie_playing===true) {
      movie_playing = false;
      button_movie.text('Replay');
      return;
    }
  
    // movie length
    var n_frames = data_size; //d3.max(node.each(function(d,i) {return i+1}));
    var frame_duration = 0.2 * 1000; // 1 fps = 20 / 2
    var duration = frame_duration * n_frames;

    // play movie
    movie_playing = true;
    button_movie.text('Pause');


    // loop over nodes until elapsed >= duration
    d3.timer(function(elapsed) {
      // offset by start pos
      elapsed = elapsed + movie_start_pos;

      // figure out which node to focus
      focus_i = Math.floor(elapsed / frame_duration);
      frame_number = focus_i + 1;
      button_movie.text('Pause ('+frame_number+' of '+n_frames+')');

      
      // loop over nodes and focus the focus node
      node.each(function(d, i) {
        d.members.map(function(dd, ii) {
          if (focus_i == dd) {
            // console.log("[movie] TR="+dd+", NodeID="+d.index);
            set_highlight(d);
            set_focus(d);
          }
        })
      })
    
      if (movie_playing === false) {
        movie_start_pos = elapsed;
        button_movie.text('Play ('+frame_number+' of '+n_frames+')');
        return true; 
      }
      if (elapsed >= duration) {
        focus_i = 0
        movie_start_pos = 0;
        movie_playing = true;
        button_movie.text('Replay');
        exit_focus();
        exit_highlight();
        return false;
      };
      return elapsed >= duration;
    })

  }

function toggle_save_as(svg, source, format) {  
  // check inputs
  var format = format ? format : 'svg';
  var save_as = source.replace(/.*\//, '')       // basename
                      .replace(/json/g, format); // ext
  // save as svg
  console.log("Saving...");
  console.log({format: format});
  save_as_svg(svg, save_as);
  console.log({saved: save_as});
}

function save_as_svg(svg, save_as){
  var svg_head = '<svg'
     + ' title="graph" version="1.1" xmlns="http://www.w3.org/2000/svg"'
     + ' width="' + svg.width() + '" height="' + svg.height() + '"'
     + ' style="margin:20%; overflow:visible;"'
     + '>';
  var svg_style = '<style>'
     + ' .node, circle {cursor: pointer;stroke-width: 1.5px;}'
     + ' .link, path {stroke: #000;stroke-width: 1.5px;}'
     + '</style>';
  var svg_save = '<svg>' 
    + svg_head + svg_style + svg.node().innerHTML + '</svg>'
    +'</svg>';
  var blob = new Blob([svg_save], {type: "image/svg+xml"});  
  saveAs(blob, save_as);
};
